import React from 'react';
import styled from 'styled-components';

import Button from '../../components/Button';

const Container = styled.div`
	display: flex;
	justify-content: center;
	align-items: center;
	height: 89vh;
`;

const ButtonAndLogoSection = styled.div`
	position: relative;
	top: 645px;
`;



const price = (props) => (
	<Container>
			<h1>JBL Xtreme 2</h1>
			<p>waterproof portable bluetooth speaker</p>
			<div>
				<img class="jbl-speakers-img" src="assets/images/xtreme2-group.png" alt="Three JBL Xtreme 2 speakers."/>
				<div class="price">
					<p><span class="hyper">$</span>299<span class="hyper">99</span></p>
				</div>
			</div>

	</Container>
)

export default price;
